import axios from "axios";
import "./index.css";
const CreateWord = (props) => {
  return (
    <div className="addbutton-container">
      <label htmlFor="word">New Word</label>
      <input
        type="text"
        id="word"
        className="input"
        value={this.word}
        onChange={this.wordChanged}
      />
      <div className="buttons-container">
        <button className="button" onClick={this.goToHome}>
          Cancel
        </button>
        <button className="button" onClick={this.getData}>
          Add
        </button>
      </div>
    </div>
  );
};

export default CreateWord;
